import styled from 'styled-components';

export const Container = styled.div`
    position: absolute;
    max-width: 400px;
    width: 100%;
    height: 200px;
    box-shadow: 0px 0px 30px #000;
    float: center;
    margin-left: 120px;
    display: flex;
         flex-direction: row;
         justify-content: center;
        align-items: center
    position: absolute;

`
